import { useEffect, useState } from "react";

import Layout from "./components/Layout/Layout";
import Product from "./components/Product/Product";

import axios from "axios";

function App() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    const getData = async () => {
      const response = await fetch(
        "https://web-ge8buw2ff-bird-and-be.vercel.app/api/interview"
      );
      const responseData = await response.json();
      const loadedProducts = [];

      for (const item in responseData.products) {
        loadedProducts.push({
          id: responseData.products[item].id,
          name: responseData.products[item].name,
          description: JSON.stringify(responseData.products[item].description),
          price: responseData.products[item].price,
        });
      }

      console.log(loadedProducts[0].description);
    };

    getData();
  }, []);

  return (
    <Layout>
      <Product />
    </Layout>
  );
}

export default App;
